import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import { withStyles } from "@material-ui/core/styles";

const styles = {
    inputRoot: {
        fontSize: 17
    },
    labelRoot: {
        fontSize: 14,
    }
};

export default function MedicationInput() {
    return (
        <Box
            component="form"
            sx={{
                '& .MuiTextField-root': {mb: 5, width: '100%'},
            }}
            noValidate
            autoComplete="on"
        >
            <div>
                <TextField
                    required
                    id="outlined-search"
                    label="Medication"
                    type="search"
                    helperText="Input your medication's name"
                />
                <br />
                <TextField
                    required
                    id="outlined-number"
                    label="Dose"
                    type="number"
                    helperText="Input your medication's dosage in mg"
                />
            </div>

            <Button variant="contained" size="large" sx={{fontSize: "17px", height: "5.75ch", width: "100%"}}> Submit</Button>
        </Box>
    );
}
